      url: "guards/EmailGuard.html",
      title: "guard - EmailGuard",
      body: "\n                   \n\n\n\n\n\n\n\n\n\n\n\n    Guards\n    EmailGuard\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n        \n            \n            File\n            \n            \n                src/app/guards/email.guard.ts\n            \n\n\n                \n                Description\n                \n                \n                    guardian que protege la ruta para actualizar la contrasea del personal cuando se envia un correo electronico para recuperar la contrasea de esta forma solo puede ser accedido cuando se haya enviado un correo electronico\n\n                \n\n\n\n\n                \n    Index\n    \n        \n\n                \n                    \n                        Methods\n                    \n                \n                \n                    \n                        \n                            \n                                canActivate\n                            \n                        \n                    \n                \n\n\n\n\n\n        \n    \n\n\n\n                \n    \n    \n        Methods\n    \n    \n        \n            \n                \n                    \n                    \n                        canActivate\n                        \n                    \n                \n            \n            \n                \ncanActivate(route: ActivatedRouteSnapshot, state: RouterStateSnapshot)\n                \n            \n\n\n            \n                \n                    Defined in src/app/guards/email.guard.ts:14\n                \n            \n\n\n            \n                \n                    si el token y el id del personal son enviados en la url de la ruta de actualizar contrasea del personal entonces se puede acceder a la ruta de actualizar contrasea del personal caso contrario se redirecciona al componente principal de la aplicacion\n\n\n                    \n                        Parameters :\n                        \n                        \n                            \n                                \n                                    Name\n                                    Type\n                                    Optional\n                                \n                            \n                            \n                                \n                                    route\n                                    \n                                                ActivatedRouteSnapshot\n                                    \n\n                                    \n                                        No\n                                    \n\n\n                                \n                                \n                                    state\n                                    \n                                                RouterStateSnapshot\n                                    \n\n                                    \n                                        No\n                                    \n\n\n                                \n                            \n                        \n                    \n                    \n                    \n                    \n                        Returns :         boolean\n\n                    \n                    \n                        \n                    \n                \n            \n        \n    \n\n        \n\n\n        \n            import { Injectable } from '@angular/core';\nimport {  ActivatedRouteSnapshot, CanActivate, RouterStateSnapshot,  } from '@angular/router';\n\n/**\n * guardian que protege la ruta para actualizar la contrasea del personal cuando se envia un correo electronico para recuperar la contrasea de esta forma solo puede ser accedido cuando se haya enviado un correo electronico\n */\n@Injectable({\n  providedIn: 'root'\n})\nexport class EmailGuard implements CanActivate {\n  /**\n   * si el token y el id del personal son enviados en la url de la ruta de actualizar contrasea del personal entonces se puede acceder a la ruta de actualizar contrasea del personal caso contrario se redirecciona al componente principal de la aplicacion\n   */\n  canActivate(\n    route: ActivatedRouteSnapshot,\n    state: RouterStateSnapshot): boolean{\n\n      const {token,id} = route.queryParams;\n      \n      if(token.length ==60 && id.length ==24){\n        return true;\n      }\n      else{\n        return false\n      }\n\n\n\n   \n\n  }\n  \n}\n\n        \n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n",
