    "guards/LoginGuard.html": {
      url: "guards/LoginGuard.html",
      title: "guard - LoginGuard",
      body: "\n                   \n\n\n\n\n\n\n\n\n\n\n\n    Guards\n    LoginGuard\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n        \n            \n            File\n            \n            \n                src/app/guards/login.guard.ts\n            \n\n\n                \n                Description\n                \n                \n                    guardian que protege las rutas principales de la aplicacion para que solo el personal logueado puedan acceder a ellas\n\n                \n\n\n\n\n                \n    Index\n    \n        \n\n                \n                    \n                        Methods\n                    \n                \n                \n                    \n                        \n                            \n                                canActivate\n                            \n                        \n                    \n                \n\n\n\n\n\n        \n    \n\n\n                \n    Constructor\n        \n            \n                \n                    \nconstructor(router: Router, StorageService: StorageService)\n                    \n                \n                        \n                            \n                                Defined in src/app/guards/login.guard.ts:17\n                            \n                        \n\n                \n                    \n                            inyeccion de servicios\n\n                            \n                                    Parameters :\n                                    \n                                        \n                                            \n                                                Name\n                                                    Type\n                                                Optional\n                                            \n                                        \n                                        \n                                                \n                                                        router\n                                                  \n                                                        \n                                                                        Router\n                                                        \n                                                  \n                                                    \n                                                            No\n                                                    \n                                                    \n                                                \n                                                \n                                                        StorageService\n                                                  \n                                                        \n                                                                        StorageService\n                                                        \n                                                  \n                                                    \n                                                            No\n                                                    \n                                                    \n                                                \n                                        \n                                    \n                            \n                    \n                \n            \n        \n\n\n                \n    \n    \n        Methods\n    \n    \n        \n            \n                \n                    \n                    \n                        canActivate\n                        \n                    \n                \n            \n            \n                \ncanActivate(route: ActivatedRouteSnapshot, state: RouterStateSnapshot)\n                \n            \n\n\n            \n                \n                    Defined in src/app/guards/login.guard.ts:32\n                \n            \n\n\n            \n                \n                    metodo que valida si el token de autenticacion existe en sessionStorage si es asi redirecciona al componente principal de la aplicacion caso contrario redirecciona al componente de login\n\n\n                    \n                        Parameters :\n                        \n                        \n                            \n                                \n                                    Name\n                                    Type\n                                    Optional\n                                \n                            \n                            \n                                \n                                    route\n                                    \n                                                ActivatedRouteSnapshot\n                                    \n\n                                    \n                                        No\n                                    \n\n\n                                \n                                \n                                    state\n                                    \n                                                RouterStateSnapshot\n                                    \n\n                                    \n                                        No\n                                    \n\n\n                                \n                            \n                        \n                    \n                    \n                    \n                    \n                        Returns :         boolean\n\n                    \n                    \n                        \n                    \n                \n            \n        \n    \n\n        \n\n\n        \n            import { Injectable } from '@angular/core';\nimport { ActivatedRouteSnapshot, CanActivate, Router, RouterStateSnapshot, UrlTree } from '@angular/router';\nimport { environment } from 'src/environments/environment';\nimport { StorageService } from '../services/storage.service';\n\n/**\n * variables que contienen el nombre de las llaves para obtener el valor de sessionStorage\n */\nconst {llaveToken,llaveRole} = environment;\n\n/**\n * guardian que protege las rutas principales de la aplicacion para que solo el personal logueado puedan acceder a ellas\n */\n@Injectable({\n  providedIn: 'root'\n})\nexport class LoginGuard implements CanActivate {\n\n    /**\n     * inyeccion de servicios\n     */\n  constructor(\n    private router: Router,\n    private StorageService: StorageService,\n    \n    ){\n\n  }\n  /**\n   * metodo que valida si el token de autenticacion existe en sessionStorage si es asi redirecciona al componente principal de la aplicacion caso contrario redirecciona al componente de login\n   */\n  canActivate(\n    route: ActivatedRouteSnapshot,\n    state: RouterStateSnapshot): boolean {\n\n      const token = this.StorageService.obtenerDeLocalStorage(llaveToken);  \n      const rol = this.StorageService.obtenerDeLocalStorage(llaveRole);  \n      \n      if(  token  && rol ){  \n        return true;\n      }\n      else { \n        sessionStorage.clear()\n        this.router.navigateByUrl(\"/login\")\n        return false\n      }\n  }\n}\n\n        \n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n",
    },
